const tasks = [
    {
        id: 1,
        text: "Doctor's Appointment",
        day: "Feb 5th at 2:30 pm",
        reminder: true,
    },
    {
        id: 2,
        text: "Meeting at School",
        day: "Feb 6th at 1:30 pm",
        reminder: true,
    },
    {
        id: 3,
        text: "Food Shopping",
        day: "Feb 5th at 2:30 pm",
        reminder: false,
    }  
]

const Tasks = () => {
  return (
    <>
    {tasks.map(() => (<h3>{tasks.text}</h3>))}
    </>
  )
}

export default Tasks
